import React from "react"

function ArtistSelection(props) {
    let cardList = props.list.map((artist, index) => {
        return (<div className={props.checkedArtists[index] ? "checked card" : "card"}>
                <img src="https://www.cheatsheet.com/wp-content/uploads/2019/05/YG.jpg"></img>
                <p key={index} 
                    onClick={() => props.handleClick(index)} >
                        {artist}
                </p>
                </div>)
    })

    return (
        <div className="cardGrid">
            {cardList}
        </div>
    )
}

export default ArtistSelection;
